import React, {Component} from "react";
import {connect} from "react-redux";

const StudentInfor = () => {
  return (

    <div>
     <form id="studentForm">
  <label htmlFor="masv">Mã sinh viên:</label><br />
  <input type="text" id="masv" name="masv" /><br /><br />
  <label htmlFor="hoten">Họ tên:</label><br />
  <input type="text" id="hoten" name="hoten" /><br /><br />
  <label htmlFor="sdt">Số điện thoại:</label><br />
  <input type="text" id="sdt" name="sdt" /><br /><br />
  <label htmlFor="email">Email:</label><br />
  <input type="email" id="email" name="email" /><br /><br />
  <input type="submit" defaultValue="Thêm sinh viên" />
</form>

    </div>
  )

}

export default StudentInfor;
